using APS.Application.Interfaces;
using APS.Application.ViewModel.Usuario;
using APS.Presentation.Web.Models;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Net;
using System.Web;
using System.Web.Mvc;
using static APS.Presentation.Web.Controllers.PostsController;

namespace APS.Presentation.Web.Controllers
{
    public class HomeController : Controller
    {

        private readonly IUsuarioAppService _serviceUsuarios;

        public HomeController(IUsuarioAppService serviceUsuarios)
        {
            _serviceUsuarios = serviceUsuarios;
        }

        [HttpGet]
        public ActionResult Index()
        {
            var listaPosts2 = BuscarPosts();
            return View(listaPosts2);
        }

        [HttpGet]
        public ActionResult Login()
        {
            return RedirectToAction(nameof(Index));
        }


        public class Info {
            public double Latitude { get; set; }
            public double Longitude { get; set; }
            public string Cidade { get; set; }
        }

        [HttpPost]
        public ActionResult AtualizarCoords(Info info)
        {
            HttpContext.Session["Latitude"] = info.Latitude;
            HttpContext.Session["Longitude"] = info.Longitude;
            HttpContext.Session["Cidade"] = info.Cidade;

            return new HttpStatusCodeResult(HttpStatusCode.OK);
        }

        [HttpPost]
        [ValidateAntiForgeryToken]
        public ActionResult Login(LoginUsuarioViewModel model)
        {
            var usuario = _serviceUsuarios.BuscarPorEmail(model.Email);
            usuario = usuario == null ? (CadastroViewModel)HttpContext.Session["UsuarioLogado"] : usuario;
            if (usuario != null && usuario.Senha.Equals(model.Senha) && usuario.Email.Equals(model.Email))
            {
                HttpContext.Session["UsuarioLogado"] = usuario;
                return View("Index", BuscarPosts());
            }
            else
            {
                ViewBag.Erros = "Usuario ou senha Inválido!";
                return View("Index",BuscarPosts());
            }
        }

        [HttpPost]
        public ActionResult LogOff() {

            Session.RemoveAll();

            return new HttpStatusCodeResult(HttpStatusCode.OK);
        }

        private ICollection<PostModel> BuscarPosts()
        {
            #region Mock Data

            if (HttpContext.Session["ListaPosts"] == null)
            {

                var listaPosts = new List<PostModel>();

                var post = new PostModel();
                var listaImagens = new List<string>();

                post.Nome = "Bagguete";
                post.Latitude = 48.858093;
                post.Longitude = 2.294694;

                listaImagens.Add("data:image/jpeg;base64,");

                post.ListaImagens = listaImagens.ToList();

                listaPosts.Add(post);


                HttpContext.Session["ListaPosts"] = listaPosts;
                HttpContext.Session["Latitude"] = -29.1689;
                HttpContext.Session["Longitude"] = -51.1785;
            }

            #endregion



            return (List<PostModel>)HttpContext.Session["ListaPosts"];
        }
    }
}